import React from 'react'
import { Button, Input, TextField, Grid } from '@material-ui/core'
import { Formik , Form} from 'formik'
import { PropObject } from '../../generated/graphql'


interface values {

}

interface Props {
    property: PropObject;
    onSubmit: (values: PropObject) => void;
}



export const PropertyForm: React.FC<Props> = (props) => {


    return (
        <Formik initialValues={props.property} onSubmit={(values: PropObject) => {
            props.onSubmit(values);
        }}>
            {({values, handleChange, handleBlur}) => (
            <Form>
                <Grid container direction="column" spacing={4}>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    name="id"
                                    label="Property ID"
                                    value={values.id} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Titel"
                                    name="title"
                                    value={values.title} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Subtext"
                                    value={values.subtext} 
                                    onChange={handleChange}
                                    onBlur={handleBlur} 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Location"
                                    value={values.location} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Longitude"
                                    value={values.long} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    id="standard-basic" 
                                    label="Latitude"
                                    value={values.lat} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <pre>
                            {JSON.stringify(values, null, 2)}
                        </pre>
                        <Grid item>
                            <Button variant="contained" type="submit">
                                speichern
                            </Button>
                        </Grid>
                    </Grid>   
            </Form>


            ) }

        </Formik>
    )


}
